window.bookSummaryJSON = "<p><b>Winner of 2019 Voice Arts Award, Audiobook Narration - Fantasy</b></p> <p>\"Closer, mortal. You are here, finally, to feed the Aching God....\"</p> <p>The days of adventure are passed for Auric Manteo. Retired to the countryside and isolated with his scars and riches, he no longer delves into forbidden ruins seeking dark wisdom and treasure. But just as old nightmares begin plaguing his sleep, he receives an urgent summons back to that old life.</p> <p>To save his only daughter, he must return to the place of his greatest trauma: the haunted Barrowlands. Along with a group of inexperienced companions and an old soldier, he must confront the dangers of the ancient and wicked Djao civilization. He has survived fell beasts, insidious traps, and deadly hazards before. But how can he contend with the malice of a bloodthirsty living god?</p>"; 
